import React, { Component } from "react";
import Card from "../../component/PersonCard";
import "./Testimonials.scss";
import logo from "./img/logo.png";
import alex from "./img/alex.png";
import katelyn from "./img/Katelyn.png";
import matthew from "./img/Matthew.png";
import jamie from "./img/jamie.png";

export default class Testimonials extends Component {
  render() {
    return (
      <div className="background">
        <div className="row">
          <Card
            namestyle={{ paddingTop: 20 }}
            locationstyle={{ paddingTop: 15 }}
            containerstyle={{ marginRight: 10 }}
            logo={logo}
            biostyle={{
              lineHeight: 1.1,
              fontSize: 21
            }}
            bio="BCIS has given me the opportunity to expand my horizons, bridging the gap to opportunities I didn't think would be there."
            pic={alex}
            firstname="Alex"
            lastname="RICHARDSON"
            age="21"
            county="Barren County"
            statename="KY"
            time="Fall, 2018"
          />
          <Card
            namestyle={{ paddingTop: 10 }}
            locationstyle={{ paddingTop: 10 }}
            logo={logo}
            biostyle={{
              lineHeight: 1.1,
              fontSize: 21
            }}
            bio="BCIS has given me the opportunity to expand my horizons, bridging the gap to opportunities I didn't think would be there."
            pic={katelyn}
            firstname="Katelyn"
            lastname="PACE"
            age="25"
            county="Metcalfe County"
            statename="KY"
            time="Fall, 2018"
          />
        </div>
        <div className="row">
          <Card
            namestyle={{ paddingTop: 25 }}
            locationstyle={{ paddingTop: 20 }}
            containerstyle={{ marginRight: 10 }}
            logo={logo}
            biostyle={{
              lineHeight: 1.1,
              fontSize: 21
            }}
            bio="BCIS has given me the opportunity to expand my horizons, bridging the gap to opportunities I didn't think would be there."
            pic={matthew}
            firstname="Matthew"
            lastname="RILEY"
            age="31"
            county="Barren County"
            statename="KY"
            time="Fall, 2018"
          />
          <Card
            namestyle={{ paddingTop: 25 }}
            locationstyle={{ paddingTop: 20 }}
            containerstyle={{ marginRight: 10 }}
            logo={logo}
            biostyle={{
              lineHeight: 1.1,
              fontSize: 21
            }}
            bio="BCIS has given me the opportunity to expand my horizons, bridging the gap to opportunities I didn't think would be there."
            pic={jamie}
            firstname="Matthew"
            lastname="RILEY"
            age="31"
            county="Barren County"
            statename="KY"
            time="Fall, 2018"
          />
        </div>
      </div>
    );
  }
}
